syntax = "proto3";
package org;




import "google/protobuf/empty.proto";

/*
ImportModelsApi返回
*/
message ImportModelsResponseWrapper {
    /*
    返回码
    */
    int32 code = 1 ;
    /*
    返回码解释
    */
    string codeExplain = 2 ;
    /*
    错误详情
    */
    string error = 3 ;
    /*
    返回数据
    */
    google.protobuf.Empty data = 4 ;
}

